텍스트에서 "@placeholder"가 무엇을 가리키는지 올바르게 추출하시오.

경찰은 침입자로부터 프린스 조지와 그의 부모를 보호하기 위해 미들턴 가족의 5백만 파운드 집 주변에 전례 없는 철갑을 형성했습니다. 말타기 경찰과 열탐지 기술이 장착된 헬리콥터가 버클베리 마너 부동산 주변을 순찰하고 있습니다. 로열 트리오가 어젯밤 지낸 버크셔주 버클베리 마너에는 국내 최대 규모의 18에이커 부동산이 있습니다. 지역 자치 당국은 칼럼과 윌리엄 모두와 함께 거처하는 무장 로열 경비대가 상주하는 조지아 시대의 집 주변 도로에서 정차 금지 규정을 시행합니다. 비디오를 보려면 아래로 스크롤하세요. 다시 돌아옵니다: 케이트가 출산하러 런던으로 돌아간 직전, 커플은 일주일간 버클베리 마너에서 보냈습니다. 어제 밤, 케임브리지 가족은 경찰에 둘러싸였습니다.
@highlight
경찰은 버클베리 마너 부동산을 도보, 말타기 및 공중에서 순찰합니다.
@highlight
전문가들은 프린스 조지 탄생 이후 보안이 크게 강화되었다고 말합니다.
@highlight
로열 베이비는 과거에 납치범과 공격자의 대상이 되었습니다.
@highlight
최근 버클베리의 나무가 울창한 마을에서 @placeholder의 부모님이 샀습니다.

